import React from "react";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import CardIcon from "@mui/icons-material/CardGiftcard";

export default function Intrestpage() {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        width: "80%", // Set width to 80%
        margin: "auto", // Center the container
      }}
    >
      <div style={{ width: "100%" }}>
        {" "}
        {/* Set width of the container to 100% */}
        <p
          style={{
            fontFamily: "Roboto",
            fontSize: 22,
            fontWeight: "bold",
            textAlign: "center",
            justifyContent: "start",
          }}
        >
          Which are you most interested in?
        </p>
        <p
          style={{
            fontFamily: "Roboto",
            textAlign: "center",
            justifyContent: "start",
          }}
        >
          Choose just one. This will help us get you started (but won't limit
          your experience).
        </p>
      </div>
      <div style={{display:"flex"}}>
      <Card variant="outlined">
      <CardContent style={{ display: "flex", alignItems: "center" }}>
        <CardIcon style={{ marginRight: "10px" }} />
        <div>
          <Typography variant="h6" component="div">
            Hi
          </Typography>
          <Typography variant="body2" color="textSecondary">
           Hellop
          </Typography>
        </div>
      </CardContent>
    </Card>
      </div>
    </div>
  );
}
